@estoescambio Al bambuco lo hemos considerado una expresión autóctona de la música colombiana.
Sin embargo nunca escuché bambucos en las emisoras que ponía mi abuela en el campo, nunca.
Solo los escucho en los festivales de música o escasos programas de radio especializados

El Dueto Nocturnal  cumple 20 años de haber sido #PríncipesDeLaCanción. Este año serán parte del 37° Festival Nacional de la Música Colombiana el próximo 15 de marzo.  #ibaguéciudadmusicaldecolombia

@mincultura @Alcaldiaibague @culturaltol
@fundacionmuscol 
@vladimirardila3 https://t.co/Tq85cPVIkd

@Doblea26u Personalmente me da igual, aunque el género musical si me da pena 🤣

Y si hablamos de los "pasos" de baile que le meten a su música choque colombiana, es peor, parecen electrocutados 

Pero como digo, solo tienen 16 o 17 ps, tmb tienen que divertirse

